    export const Example = () => {
      <BasicBox
          title="Heading Text"
          description="Description text goes here"
          headerActions={
            <>
                <Button
                  appearance="secondary"
                  color="black"
                  isSmall={true}
                  icon="Upload"
                >
                  Upload
                </Button>
              <Button appearance="primary" color="blue" isSmall={true}>
                 Create new
              </Button>
            </>
          }
          footerActions={[
            "Example of footer content on left",
            <Button key={0} appearance="primary" color="blue" isSmall={true}>
               Save changes
            </Button>,
          ]}
        >
            <SettingBlock
                title="Import"
                description="Import your blocklist and allowlist from another website."
            >
                <p>
                  Upload the blocklist and allowlist CSV file exported from another
                  website. Imported user agents will be added to the existing blocklist
                  and allowlist.
                </p>
                <div>
                  <Button
                       appearance="secondary"
                       icon="Upload"
                       color="black"
                       isSmall={true}
                    >
                      Upload file
                  </Button>
                </div>
            </SettingBlock>
            <SettingBlock
                title="Export"
                description="Export your blocklist and allowlist for use on another website."
            >
                <Button
                    appearance="secondary"
                    icon="Upload"
                    color="black"
                    isSmall={true}
                  >
                    Export
                </Button>
            </SettingBlock>
      </BasicBox>
    }
